export default function Element({rank, icon, name, symbol, priceUsd, percent24}){

    const dot = priceUsd.indexOf(".")
    const dot2 = percent24.indexOf(".")
    let newString = ''
    let newString2 = ''
    for(let i = 0; i < dot2+4; i++){
        newString2 = percent24[i]
    }
    if(priceUsd[0] === '0'){
        for(let i = 0; i < dot+7; i++){
            newString += priceUsd[i]
        }
    }else{
        for(let i = 0; i < dot+4; i++){
            newString += priceUsd[i]
        }

    }

    return(
        <tr className="each">
            <td className="rank">{rank}</td>
            <td>{icon}</td>
            <td>
                <span>{symbol} </span>
                <span>{name}</span>
            </td>
            <td>U${newString}</td>
            <td>{newString2}%</td>
        </tr>
    )
}
